import { Link } from "react-router-dom";
import style from "../Start/Start.module.css";
import image from "../../ps4-control.webp";

export const Start = () => {
  return (
    <div
      className={style.contenedor}
      style={{ backgroundImage: `url("../../ps4-control.webp")` }}
    >
      <h1>Este Es Inicio</h1>
      <Link to="Home">
        <button>Star</button>
      </Link>
    </div>
  );
};
